@Injectable({
  providedIn: 'root'
})
export class ApiserviceService {

  baseURL: string = "https://4001.hoteladvisor.net/"


  constructor(private http: HttpClient) {

  }

  async findCard(obj: String): Promise<GetCardResponseModel> {
    var result = new GetCardResponseModel;

    var response =  await this.http.post(
      this.baseURL,
       obj
      ).subscribe((data: any) => {
        result = result.fromJson(JSON.parse(data[0][0]));
      })

      console.log(response);

    return  result;
  }

}
